import React from "react";
import pic from "../../../image/asadullah.png";
import "./Header.css";
const Header = () => {
  return (
    <div className="container">
      <div className="page-header">
        <div className="header-info p-5">
          <div className="row g-3 justify-content-center align-items-center">
            <div className="col-md-4 col-12">
              <img className="img-fluid image" src={pic} alt="" />
            </div>
            <div className="col-md-8 col-12 text-center border">
              <h1 className="home-title">Asadullah Ahmed</h1>
              <h1 className="sub-title">Web Developer</h1>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
